import AboutHero from 'components/AboutHero/AboutHero';
import Customers from 'components/Customers/Customers';
import FaqBlock from 'components/Faq/FaqBlock';
import TeamCompound from 'components/TeamCompound/TeamCompound';

const AboutUs = () => {
  const faqsData = [
    {
      question: 'What services does StellarLikes offer?',
      answer:
        'StellarLikes provides options to buy TikTok likes, followers, and views, helping to boost your profile visibility and engagement on the platform.',
      open: false,
    },
    {
      question: 'Are the followers and likes real?',
      answer:
        'Yes, StellarLikes aims to deliver authentic engagement from real accounts to maintain quality and authenticity on your TikTok profile.',
      open: false,
    },
    {
      question: 'How quickly will I see results after purchase?',
      answer:
        'Orders typically start processing within a few minutes, with full delivery within 15-30 minutes, depending on the package size.',
      open: false,
    },
    {
      question: 'Is it safe to buy TikTok likes and followers?',
      answer:
        'Absolutely. StellarLikes uses secure, compliant methods to enhance your profile without risk to your account’s safety.',
      open: false,
    },
    {
      question: 'Can I customize my order?',
      answer:
        'Yes, we offer custom packages to meet your unique engagement needs. Contact support for more details.',
      open: false,
    },
    {
      question: 'Do you offer refunds?',
      answer:
        "Buying views can make your video more visible. But, creating great content is crucial. It's the best way to go viral on TikTok.",
      open: false,
    },
    {
      question: 'How does buying views impact the TikTok algorithm?',
      answer:
        'Buying views can help your video rank better. It shows TikTok that your content is popular. This can lead to more people seeing your videos.',
      open: false,
    },
    {
      question: 'What are the steps to buy TikTok views?',
      answer:
        'First, find a trusted provider. Then, pick a package and buy it. Finally, watch how your views and engagement change.',
      open: false,
    },
    {
      question:
        'What ethical considerations should be taken into account when buying TikTok views?',
      answer:
        "There's a debate on buying views. Some see it as unfair. But, it can help grow your account. Just be true to yourself and your audience.",
      open: false,
    },
    {
      question: 'How can I convert bought views into organic growth?',
      answer:
        "To turn bought views into real growth, make great content. Talk to your followers and use TikTok's features. This keeps your momentum going.",
      open: false,
    },
  ];
  return (
    <>
      <AboutHero />
      <TeamCompound />
      <Customers />
      <FaqBlock faqsData={faqsData} />
    </>
  );
};

export default AboutUs;
